<!DOCTYPE html>
<html>

<head>
	<title>50Results</title>
	<meta charset="utf-8" />
	<link rel="stylesheet" href="assets/css/main.css" type="text/css" />
	<script src="assets/script.js" defer></script>

</head>

<body>
	<div class="stage">
		<div class="1to5">
			<div class="Box1 element"></div>
			<div class="Box2 text-focus-in"></div>
			<div class="Box3 bounce-in-top"></div>
			<div class="Box4 text-flicker-in-glow "></div>
			<div class="Box5 text-flicker-in-glow-2"></div>
		</div>

		<div class="6to10">
			<div class="Box6 spinningSQUARE"></div>
			<div class="Box7 spinningSQUARE2"></div>
			<div class="Box8 text-blur-out"></div>
			<div class="Box9 puff-in-center"></div>
			<div class="Box10 vibrate-1"></div>
		</div>

		<div class="11to15">
			<div class="Box11 skew"></div>
			<div class="Box12 skewCLICK"></div>
			<div class="Box13 jello-horizontal"></div>
			<div class="Box14 swing-in-left-bck"></div>
			<div class="Box15 "></div>
		</div>

		<div class="16to20">
			<div class="Box16 glitching"></div>
			<div class="Box17 bounce-out-bottom"></div>
			<div class="Box18 div1"></div>
			<div class="Box19 spinningSQUARE3"></div>
			<div class="Box20 squarecolorORANGE"></div>
		</div>

		<div class="21to25">
			<div class="Box21 gradient"></div>
			<div class="Box22 gradient2"></div>
			<div class="Box23 blink2"></div>
			<div class="Box24 spinningSQUARE24"></div>
			<div class="Box25 wobble-hor-bottom"></div>
		</div>

		<div class="26to30">
			<div class="Box26 askewy"></div>
			<div class="Box27 askewy2"></div>
			<div class="Box28 "></div>
			<div class="Box29 "></div>
			<div class="Box30 "></div>
		</div>

		<div class="31to35">
			<div class="Box31 "></div>
			<div class="Box32 "></div>
			<div class="Box33 "></div>
			<div class="Box34 "></div>
			<div class="Box35 "></div>
		</div>

		<div class="36to40">
			<div class="Box36 "></div>
			<div class="Box37 "></div>
			<div class="Box38 "></div>
			<div class="Box39 "></div>
			<div class="Box40 "></div>
		</div>

		<div class="41to45">
			<div class="Box41 "></div>
			<div class="Box42 "></div>
			<div class="Box43 "></div>
			<div class="Box44 "></div>
			<div class="Box45 "></div>
		</div>

		<div class="46to50">
			<div class="Box46 "></div>
			<div class="Box47 "></div>
			<div class="Box48 "></div>
			<div class="Box49 "></div>
			<div class="Box50 "></div>
		</div>
	</div>
</body>

</html>
